import "./aboutme.scss";

export default function Aboutme() {
  return (
    <div className="aboutme" id="aboutme">
  <h1>
    Aboutme
  </h1>
  <ul>
    <li>Web app</li>
    <li>Applications</li>
  </ul>
  <div className="container"></div>
    </div>
  )
}
